import axios from "axios"

function App() {

axios.get("https://dog.ceo/api/breeds/list/all").then(res =>{
  console.log(res.data.message[0].length)
})


  return (

    <div className="App">
      <NavBar/>
      <main>
        <ItemListContainer/>
      </main>
      <Footer/>
    </div>

  )
}

export default App;
